    "displayName": "OpenEBS",
    "description": "**OpenEBS** is a leading open source container attached storage solution that  enables the use of containers for mission-critical, persistent workloads and  for other stateful workloads such as logging or Prometheus for example.\nOpenEBS itself is deployed as just another container on your host and enables  storage services that can be designated on a per pod, application, cluster  or container level, including: \n* Data persistence across nodes\n* Synchronization of data across availability zones and cloud providers\n* A common layer whether you are running on the cloud, or your bare metal\n* Integration with Kubernetes, so developer and application intent flows into OpenEBS\n* Management of tiering to and from S3 and other targets.\n## OpenEBS Chaos Charts\nOpenEBS chaos charts are created to inject failures into the control and data plane deployments  with application and component-level health checks defined as exit-criteria. A brief overview of the available sub-charts is provided below. \n* **TargetChaos** - Injects state & network chaos on OpenEBS iSCSI target pods \n* **PoolChaos** - Injects state, network and disk chaos on OpenEBS sparse & zfs based storage pool pods  \n* **ControlPlaneChaos** - Injects state, network chaos & api failures on maya apiserver, provisioner & other components\n## Getting Started\n* Learn more about these experiments [here](https://github.com/litmuschaos/litmus)\n",
