    "displayName": "Kubernetes",
    "description": "**Kubernetes** is an open-source system for automating deployment, scaling, and management of containerized  applications. It groups containers that make up an application into logical units for easy management and discovery.  Kubernetes builds upon 15 years of experience of running production workloads at Google, combined with best-of-breed  ideas and practices from the community. \n\n## OpenEBS Chaos Charts\nKubernetes chaos charts are created to inject failures into any application deployments on K8s with user-defined health checks (typically, app availability) as exit criteria. Some of the available  sub-charts is provided below. \n* **StateChaos** - Injects random pod-level and container level-failures against specified app replicas \n* **NetworkChaos** - Injects random network jitters, delays and packet loss on the app replica pods  \n## Getting Started\n* Learn more about these experiments [here](https://github.com/litmuschaos/litmus)\n",
